import React from 'react'
import './Css files/moviesearch.css'
export default function MovieSearch(props) {
  const { original_title, overview, popularity, release_date, poster_path, id } = props.DataTrans
  const { handleFav } = props.handleFav
  return (
    <>

      <div className='Movie-Body'>
        <div><img src="https://image.tmdb.org/t/p/w500///xqGL2qkM3Ux7Hf5YtfJlNyoTUfH.jpg" className='image' /> </div>
        <div><h3>{original_title}</h3>
          {overview}
          {popularity}
          {release_date}</div>

        <button onClick={(e) => handleFav(e, id)}>Favorite</button>
      </div>

    </>
  )
}
